    QUnit.skip( "Day 1, part 1. Find the sum of all digits that match the next digit in the list. The list is circular, " +

        assert.equal( findSumPart1("1122"), 3, "1122 produces a sum of 3 (1 + 2) because the first digit (1) matches " +
            "the second digit and the third digit (2) matches the fourth digit." );
        assert.equal( findSumPart1("1111"), 4, "1111 produces 4 because each digit (all 1) matches the next." );
        assert.equal( findSumPart1("1234"), 0, "1234 produces 0 because no digit matches the next." );
        assert.equal( findSumPart1("91212129"), 9, "91212129 produces 9 because the only digit that matches the next " +
            "one is the last digit, 9." );
    });

        assert.equal( findSumPart2("1221"), 0, "1221 produces 0, because every comparison is between a 1 and a 2." );

    QUnit.skip("Day 3, part 1. Each square on the grid is allocated in a spiral pattern starting at a location marked 1 and then counting up while spiraling outward. For example, the first few squares are allocated like this:\n" +

    QUnit.skip("Day 5, part 1. The message includes a list of the offsets for each jump. Jumps are relative: -1 moves to the previous instruction, and 2 skips the next one. Start at the first instruction in the list. The goal is to follow the jumps until one leads outside the list.\n" +
        "\n" +
        "In addition, these instructions are a little strange; after each jump, the offset of that instruction increases by 1. So, if you come across an offset of 3, you would move three instructions forward, but change it to a 4 for the next time it is encountered.\n" +
        "\n" +
        "For example, consider the following list of jump offsets:\n" +
        "\n" +
        "0\n" +
        "3\n" +
        "0\n" +
        "1\n" +
        "-3\n" +
        "\n" +
        "Positive jumps (\"forward\") move downward; negative jumps move upward. For legibility in this example, these offset values will be written all on one line, with the current instruction marked in parentheses. The following steps would be taken before an exit is found:\n" +
        "\n" +
        "    (0) 3  0  1  -3  - before we have taken any steps.\n" +
        "    (1) 3  0  1  -3  - jump with offset 0 (that is, don't jump at all). Fortunately, the instruction is then incremented to 1.\n" +
        "     2 (3) 0  1  -3  - step forward because of the instruction we just modified. The first instruction is incremented again, now to 2.\n" +
        "     2  4  0  1 (-3) - jump all the way to the end; leave a 4 behind.\n" +
        "     2 (4) 0  1  -2  - go back to where we just were; increment -3 to -2.\n" +
        "     2  5  0  1  -2  - jump 4 steps forward, escaping the maze.\n" +
        "\n" +
        "In this example, the exit is reached in 5 steps.", function (assert) {
        assert.equal(countStepsToEscapeMazePart1([0,3,0,1,-3]), 5);
    });

    QUnit.skip("Day 6, part 1. In this area, there are sixteen memory banks; each memory bank can hold any number of blocks. The goal of the reallocation routine is to balance the blocks between the memory banks.\n" +
        "\n" +
        "The reallocation routine operates in cycles. In each cycle, it finds the memory bank with the most blocks (ties won by the lowest-numbered memory bank) and redistributes those blocks among the banks. To do this, it removes all of the blocks from the selected bank, then moves to the next (by index) memory bank and inserts one of the blocks. It continues doing this until it runs out of blocks; if it reaches the last memory bank, it wraps around to the first one.\n" +
        "\n" +
        "The debugger would like to know how many redistributions can be done before a blocks-in-banks configuration is produced that has been seen before.\n" +
        "\n" +
        "For example, imagine a scenario with only four memory banks:\n" +
        "\n" +
        "    The banks start with 0, 2, 7, and 0 blocks. The third bank has the most blocks, so it is chosen for redistribution.\n" +
        "    Starting with the next bank (the fourth bank) and then continuing to the first bank, the second bank, and so on, the 7 blocks are spread out over the memory banks. The fourth, first, and second banks get two blocks each, and the third bank gets one back. The final result looks like this: 2 4 1 2.\n" +
        "    Next, the second bank is chosen because it contains the most blocks (four). Because there are four memory banks, each gets one block. The result is: 3 1 2 3.\n" +
        "    Now, there is a tie between the first and fourth memory banks, both of which have three blocks. The first bank wins the tie, and its three blocks are distributed evenly over the other three banks, leaving it with none: 0 2 3 4.\n" +
        "    The fourth bank is chosen, and its four blocks are distributed such that each of the four banks receives one: 1 3 4 1.\n" +
        "    The third bank is chosen, and the same thing happens: 2 4 1 2.\n" +
        "\n" +
        "At this point, we've reached a state we've seen before: 2 4 1 2 was already seen. The infinite loop is detected" +
        " after the fifth block redistribution cycle, and so the answer in this example is 5.", function (assert) {
        assert.equal(countRedistributionCyclesPart1([0,2,7,0]), 5);
    });

    QUnit.skip("Day 6, part 2. Out of curiosity, the debugger would also like to know the size of the loop: starting from a state that has already been seen, how many block redistribution cycles must be performed before that same state is seen again?\n" +
        "\n" +
        "In the example above, 2 4 1 2 is seen again after four cycles, and so the answer in that example would be 4.", function (assert) {
        assert.equal(countRedistributionCyclesPart2([0,2,7,0]), 4);
    });

    QUnit.skip("Day 7, part 1. One program at the bottom supports the entire tower. It's holding a large disc, and on the disc are balanced several more sub-towers. At the bottom of these sub-towers, standing on the bottom disc, are other programs, each holding their own disc, and so on. At the very tops of these sub-sub-sub-...-towers, many programs stand simply keeping the disc below them balanced but with no disc of their own.\n" +
        "\n" +
        "You offer to help, but first you need to understand the structure of these towers. You ask each program to yell out their name, their weight, and (if they're holding a disc) the names of the programs immediately above them balancing on that disc. You write this information down (your puzzle input). Unfortunately, in their panic, they don't do this in an orderly fashion; by the time you're done, you're not sure which program gave which information.\n" +
        "\n" +
        "For example, if your list is the following:\n" +
        "\n" +
        "pbga (66)\n" +
        "xhth (57)\n" +
        "ebii (61)\n" +
        "havc (66)\n" +
        "ktlj (57)\n" +
        "fwft (72) -> ktlj, cntj, xhth\n" +

        "padx (45) -> pbga, havc, qoyq\n" +

    });

    QUnit.skip("Day 8, part 1. Each instruction consists of several parts: the register to modify, whether to increase or decrease that register's value, the amount by which to increase or decrease it, and a condition. If the condition fails, skip the instruction without modifying the register. The registers all start at 0. The instructions look like this:\n" +
        "\n" +
        "b inc 5 if a > 1\n" +
        "a inc 1 if b < 5\n" +
        "c dec -10 if a >= 1\n" +
        "c inc -20 if c == 10\n" +
        "\n" +
        "These instructions would be processed as follows:\n" +
        "\n" +
        "    Because a starts at 0, it is not greater than 1, and so b is not modified.\n" +
        "    a is increased by 1 (to 1) because b is less than 5 (it is 0).\n" +
        "    c is decreased by -10 (to 10) because a is now greater than or equal to 1 (it is 1).\n" +
        "    c is increased by -20 (to -10) because c is equal to 10.\n" +
        "\n" +
        "After this process, the largest value in any register is 1.\n" +
        "\n" +
        "You might also encounter <= (less than or equal to) or != (not equal to). However, the CPU doesn't have the bandwidth to tell you what all the registers are named, and leaves that to you to determine.\n" +
        "\n" +
        "What is the largest value in any register after completing the instructions in your puzzle input?", function (assert) {
        assert.equal(findLargestValueInRegistersPart1(['b inc 5 if a > 1', 'a inc 1 if b < 5', 'c dec -10 if a >= 1', 'c inc -20 if c == 10']), 1)
    });

    QUnit.skip("Day 8, part 2. To be safe, the CPU also needs to know the highest value held in any register during this process so that it can decide how much memory to allocate to these operations. For example, in the above instructions, the highest value ever held was 10 (in register c after the third instruction was evaluated).", function (assert) {
        assert.equal(findLargestValueInRegistersPart2(['b inc 5 if a > 1', 'a inc 1 if b < 5', 'c dec -10 if a >= 1', 'c inc -20 if c == 10']), 10)
    });

    QUnit.skip("Day 9, part 1. You sit for a while and record part of the stream (your puzzle input). The characters represent groups - sequences that begin with { and end with }. Within a group, there are zero or more other things, separated by commas: either another group or garbage. Since groups can contain other groups, a } only closes the most-recently-opened unclosed group - that is, they are nestable. Your puzzle input represents a single, large group which itself contains many smaller ones.\n" +
        "\n" +
        "Sometimes, instead of a group, you will find garbage. Garbage begins with < and ends with >. Between those angle brackets, almost any character can appear, including { and }. Within garbage, < has no special meaning.\n" +
        "\n" +
        "In a futile attempt to clean up the garbage, some program has canceled some of the characters within it using !: inside garbage, any character that comes after ! should be ignored, including <, >, and even another !.\n" +
        "\n" +
        "You don't see any characters that deviate from these rules. Outside garbage, you only find well-formed groups, and garbage always terminates according to the rules above.\n" +
        "\n" +
        "Here are some self-contained pieces of garbage:\n" +
        "\n" +
        "    <>, empty garbage.\n" +
        "    <random characters>, garbage containing random characters.\n" +
        "    <<<<>, because the extra < are ignored.\n" +
        "    <{!>}>, because the first > is canceled.\n" +
        "    <!!>, because the second ! is canceled, allowing the > to terminate the garbage.\n" +
        "    <!!!>>, because the second ! and the first > are canceled.\n" +
        "    <{o\"i!a,<{i<a>, which ends at the first >.\n" +
        "\n" +
        "Here are some examples of whole streams and the number of groups they contain:\n" +
        "\n" +
        "    {}, 1 group.\n" +
        "    {{{}}}, 3 groups.\n" +
        "    {{},{}}, also 3 groups.\n" +
        "    {{{},{},{{}}}}, 6 groups.\n" +
        "    {<{},{},{{}}>}, 1 group (which itself contains garbage).\n" +
        "    {<a>,<a>,<a>,<a>}, 1 group.\n" +
        "    {{<a>},{<a>},{<a>},{<a>}}, 5 groups.\n" +
        "    {{<!>},{<!>},{<!>},{<a>}}, 2 groups (since all but the last > are canceled).\n" +
        "\n" +
        "Your goal is to find the total score for all groups in your input. Each group is assigned a score which is one more than the score of the group that immediately contains it. (The outermost group gets a score of 1.)\n" +
        "\n" +
        "    {}, score of 1.\n" +
        "    {{{}}}, score of 1 + 2 + 3 = 6.\n" +
        "    {{},{}}, score of 1 + 2 + 2 = 5.\n" +
        "    {{{},{},{{}}}}, score of 1 + 2 + 3 + 3 + 3 + 4 = 16.\n" +
        "    {<a>,<a>,<a>,<a>}, score of 1.\n" +
        "    {{<ab>},{<ab>},{<ab>},{<ab>}}, score of 1 + 2 + 2 + 2 + 2 = 9.\n" +
        "    {{<!!>},{<!!>},{<!!>},{<!!>}}, score of 1 + 2 + 2 + 2 + 2 = 9.\n" +
        "    {{<a!>},{<a!>},{<a!>},{<ab>}}, score of 1 + 2 = 3.\n" +
        "\n" +
        "What is the total score for all groups in your input?", function (assert) {
        assert.equal(getTotalScoreForGroupsPart1('{}'), 1, "score of 1");
        assert.equal(getTotalScoreForGroupsPart1('{{{}}}'), 6, "score of 1 + 2 + 3 = 6");
        assert.equal(getTotalScoreForGroupsPart1('{{},{}}'), 5, "score of 1 + 2 + 2 = 5");
        assert.equal(getTotalScoreForGroupsPart1('{{{},{},{{}}}}'), 16, "score of 1 + 2 + 3 + 3 + 3 + 4 = 16");
        assert.equal(getTotalScoreForGroupsPart1('{<a>,<a>,<a>,<a>}'), 1, "score of 1");
        assert.equal(getTotalScoreForGroupsPart1('{{<ab>},{<ab>},{<ab>},{<ab>}}'), 9, "score of 1 + 2 + 2 + 2 + 2 = 9");
        assert.equal(getTotalScoreForGroupsPart1('{{<!!>},{<!!>},{<!!>},{<!!>}}'), 9, "score of 1 + 2 + 2 + 2 + 2 = 9");
        assert.equal(getTotalScoreForGroupsPart1('{{<a!>},{<a!>},{<a!>},{<ab>}}'), 3, "score of 1 + 2 = 3");
    });

    QUnit.skip("Day 9, part 2. Now, you're ready to remove the garbage.\n" +
        "\n" +
        "To prove you've removed it, you need to count all of the characters within the garbage. The leading and trailing < and > don't count, nor do any canceled characters or the ! doing the canceling.\n" +

    QUnit.skip("Day 10, part 1. You come across some programs that are trying to implement a software emulation of a hash based on knot-tying. The hash these programs are implementing isn't very strong, but you decide to help them anyway. You make a mental note to remind the Elves later not to invent their own cryptographic functions.\n" +
        "\n" +
        "This hash function simulates tying a knot in a circle of string with 256 marks on it. Based on the input to be hashed, the function repeatedly selects a span of string, brings the ends together, and gives the span a half-twist to reverse the order of the marks within it. After doing this many times, the order of the marks is used to build the resulting hash. [...] begin with a list of numbers from 0 to 255, a current position which begins at 0 (the first element in the list), a skip size (which starts at 0), and a sequence of lengths (your puzzle input). Then, for each length:\n" +
        "\n" +
        "Reverse the order of that length of elements in the list, starting with the element at the current position.\n" +
        "Move the current position forward by that length plus the skip size.\n" +
        "Increase the skip size by one.\n" +
        "The list is circular; if the current position and the length try to reverse elements beyond the end of the list, the operation reverses using as many extra elements as it needs from the front of the list. If the current position moves past the end of the list, it wraps around to the front. Lengths larger than the size of the list are invalid.\n" +
        "\n" +
        "Here's an example using a smaller list:\n" +
        "\n" +
        "Suppose we instead only had a circular list containing five elements, 0, 1, 2, 3, 4, and were given input lengths of 3, 4, 1, 5.\n" +
        "\n" +
        "The list begins as [0] 1 2 3 4 (where square brackets indicate the current position).\n" +
        "The first length, 3, selects ([0] 1 2) 3 4 (where parentheses indicate the sublist to be reversed).\n" +
        "After reversing that section (0 1 2 into 2 1 0), we get ([2] 1 0) 3 4.\n" +
        "Then, the current position moves forward by the length, 3, plus the skip size, 0: 2 1 0 [3] 4. Finally, the skip size increases to 1.\n" +
        "The second length, 4, selects a section which wraps: 2 1) 0 ([3] 4.\n" +
        "The sublist 3 4 2 1 is reversed to form 1 2 4 3: 4 3) 0 ([1] 2.\n" +
        "The current position moves forward by the length plus the skip size, a total of 5, causing it not to move because it wraps around: 4 3 0 [1] 2. The skip size increases to 2.\n" +
        "The third length, 1, selects a sublist of a single element, and so reversing it has no effect.\n" +
        "The current position moves forward by the length (1) plus the skip size (2): 4 [3] 0 1 2. The skip size increases to 3.\n" +
        "The fourth length, 5, selects every element starting with the second: 4) ([3] 0 1 2. Reversing this sublist (3 0 1 2 4 into 4 2 1 0 3) produces: 3) ([4] 2 1 0.\n" +
        "Finally, the current position moves forward by 8: 3 4 2 1 [0]. The skip size increases to 4.\n" +
        "In this example, the first two numbers in the list end up being 3 and 4; to check the process, you can multiply them together to produce 12.\n" +
        "\n" +

    QUnit.skip("Day 10, part 2. The logic you've constructed forms a single round of the Knot Hash algorithm; running the full thing requires many of these rounds. Some input and output processing is also required.\n" +
        "\n" +
        "First, from now on, your input should be taken not as a list of numbers, but as a string of bytes instead. Unless otherwise specified, convert characters to bytes using their ASCII codes. This will allow you to handle arbitrary ASCII strings, and it also ensures that your input lengths are never larger than 255. For example, if you are given 1,2,3, you should convert it to the ASCII codes for each character: 49,44,50,44,51.\n" +
        "\n" +
        "Once you have determined the sequence of lengths to use, add the following lengths to the end of the sequence: 17, 31, 73, 47, 23. For example, if you are given 1,2,3, your final sequence of lengths should be 49,44,50,44,51,17,31,73,47,23 (the ASCII codes from the input string combined with the standard length suffix values).\n" +
        "\n" +
        "Second, instead of merely running one round like you did above, run a total of 64 rounds, using the same length sequence in each round. The current position and skip size should be preserved between rounds. For example, if the previous example was your first round, you would start your second round with the same length sequence (3, 4, 1, 5, 17, 31, 73, 47, 23, now assuming they came from ASCII codes and include the suffix), but start with the previous round's current position (4) and skip size (4).\n" +
        "\n" +
        "Once the rounds are complete, you will be left with the numbers from 0 to 255 in some order, called the sparse hash. Your next task is to reduce these to a list of only 16 numbers called the dense hash. To do this, use numeric bitwise XOR to combine each consecutive block of 16 numbers in the sparse hash (there are 16 such blocks in a list of 256 numbers). So, the first element in the dense hash is the first sixteen elements of the sparse hash XOR'd together, the second element in the dense hash is the second sixteen elements of the sparse hash XOR'd together, etc.\n" +
        "\n" +
        "For example, if the first sixteen elements of your sparse hash are as shown below, and the XOR operator is ^, you would calculate the first output number like this:\n" +
        "\n" +
        "65 ^ 27 ^ 9 ^ 1 ^ 4 ^ 3 ^ 40 ^ 50 ^ 91 ^ 7 ^ 6 ^ 0 ^ 2 ^ 5 ^ 68 ^ 22 = 64\n" +
        "Perform this operation on each of the sixteen blocks of sixteen numbers in your sparse hash to determine the sixteen numbers in your dense hash.\n" +
        "\n" +
        "Finally, the standard way to represent a Knot Hash is as a single hexadecimal string; the final output is the dense hash in hexadecimal notation. Because each number in your dense hash will be between 0 and 255 (inclusive), always represent each number as two hexadecimal digits (including a leading zero as necessary). So, if your first three numbers are 64, 7, 255, they correspond to the hexadecimal numbers 40, 07, ff, and so the first six characters of the hash would be 4007ff. Because every Knot Hash is sixteen such numbers, the hexadecimal representation is always 32 hexadecimal digits (0-f) long.\n" +
        "\n" +
        "Here are some example hashes:\n" +
        "\n" +
        "The empty string becomes a2582a3a0e66e6e86e3812dcb672a272.\n" +
        "AoC 2017 becomes 33efeb34ea91902bb2f59c9920caa6cd.\n" +
        "1,2,3 becomes 3efbe78a8d82f29979031a4aa0b16a9d.\n" +
        "1,2,4 becomes 63960835bcdc130f0b66d7ff4f6a5a8e.\n" +
        "Treating your puzzle input as a string of ASCII characters, what is the Knot Hash of your puzzle input? Ignore any leading or trailing whitespace you might encounter.\n" +
        "\n", function (assert) {
        assert.equal(makeKnotHash(256, '102,255,99,252,200,24,219,57,103,2,226,254,1,0,69,216'), "44f4befb0f303c0bafd085f97741d51d");
    });

    QUnit.skip("Day 12, part 1. Walking along the memory banks of the stream, you find a small village that is experiencing a little confusion: some programs can't communicate with each other.\n" +
        "\n" +
        "Programs in this village communicate using a fixed system of pipes. Messages are passed between programs using these pipes, but most programs aren't connected to each other directly. Instead, programs pass messages between each other until the message reaches the intended recipient.\n" +
        "\n" +
        "For some reason, though, some of these messages aren't ever reaching their intended recipient, and the programs suspect that some pipes are missing. They would like you to investigate.\n" +
        "\n" +
        "You walk through the village and record the ID of each program and the IDs with which it can communicate directly (your puzzle input). Each program has one or more programs with which it can communicate, and these pipes are bidirectional; if 8 says it can communicate with 11, then 11 will say it can communicate with 8.\n" +
        "\n" +
        "You need to figure out how many programs are in the group that contains program ID 0.\n" +
        "\n" +
        "For example, suppose you go door-to-door like a travelling salesman and record the following list:\n" +
        "\n" +
        "0 <-> 2\n" +
        "1 <-> 1\n" +
        "2 <-> 0, 3, 4\n" +
        "3 <-> 2, 4\n" +
        "4 <-> 2, 3, 6\n" +
        "5 <-> 6\n" +
        "6 <-> 4, 5\n" +
        "In this example, the following programs are in the group that contains program ID 0:\n" +
        "\n" +
        "Program 0 by definition.\n" +
        "Program 2, directly connected to program 0.\n" +
        "Program 3 via program 2.\n" +
        "Program 4 via program 2.\n" +
        "Program 5 via programs 6, then 4, then 2.\n" +
        "Program 6 via programs 4, then 2.\n" +
        "Therefore, a total of 6 programs are in this group; all but program 1, which has a pipe that connects it to itself.\n" +
        "\n" +
        "How many programs are in the group that contains program ID 0?", function (assert) {
        const programList = [
            {communicatesDirectlyWith: [2]},
            {communicatesDirectlyWith: [1]},
            {communicatesDirectlyWith: [0,3,4]},
            {communicatesDirectlyWith: [2,4]},
            {communicatesDirectlyWith: [2,3,6]},
            {communicatesDirectlyWith: [6]},
            {communicatesDirectlyWith: [4,5]}
            ];
        assert.equal(countProgramsPart1(0, programList), 6);
    });

    QUnit.skip("Day 12, part 2. There are more programs than just the ones in the group containing program ID 0. The rest of them have no way of reaching that group, and still might have no way of reaching each other.\n" +

    QUnit.skip("Day 14, part 1. Suddenly, a scheduled job activates the system's disk defragmenter. Were the situation different, you might sit and watch it for a while, but today, you just don't have that kind of time. It's soaking up valuable system resources that are needed elsewhere, and so the only option is to help it finish its task as soon as possible.\n" +
        "\n" +
        "The disk in question consists of a 128x128 grid; each square of the grid is either free or used. On this disk, the state of the grid is tracked by the bits in a sequence of knot hashes.\n" +
        "\n" +
        "A total of 128 knot hashes are calculated, each corresponding to a single row in the grid; each hash contains 128 bits which correspond to individual grid squares. Each bit of a hash indicates whether that square is free (0) or used (1).\n" +
        "\n" +
        "The hash inputs are a key string (your puzzle input), a dash, and a number from 0 to 127 corresponding to the row. For example, if your key string were flqrgnkx, then the first row would be given by the bits of the knot hash of flqrgnkx-0, the second row from the bits of the knot hash of flqrgnkx-1, and so on until the last row, flqrgnkx-127.\n" +
        "\n" +
        "The output of a knot hash is traditionally represented by 32 hexadecimal digits; each of these digits correspond to 4 bits, for a total of 4 * 32 = 128 bits. To convert to bits, turn each hexadecimal digit to its equivalent binary value, high-bit first: 0 becomes 0000, 1 becomes 0001, e becomes 1110, f becomes 1111, and so on; a hash that begins with a0c2017... in hexadecimal would begin with 10100000110000100000000101110000... in binary.\n" +
        "\n" +
        "Continuing this process, the first 8 rows and columns for key flqrgnkx appear as follows, using # to denote used squares, and . to denote free ones:\n" +

        "##.#.#..-->\n" +
        ".#.#.#.#   \n" +
        "....#.#.   \n" +
        "#.#.##.#   \n" +
        ".##.#...   \n" +
        "##..#..#   \n" +
        ".#...#..   \n" +
        "##.#.##.-->\n" +
        "|      |   \n" +
        "V      V   \n" +
        "\n" +
        "In this example, 8108 squares are used across the entire 128x128 grid.\n" +

    QUnit.skip("Day 17, part 1. Suddenly, whirling in the distance, you notice what looks like a massive, pixelated hurricane: a deadly spinlock. This spinlock isn't just consuming computing power, but memory, too; vast, digital mountains are being ripped from the ground and consumed by the vortex.\n" +
        "\n" +
        "If you don't move quickly, fixing that printer will be the least of your problems.\n" +
        "\n" +
        "This spinlock's algorithm is simple but efficient, quickly consuming everything in its path. It starts with a circular buffer containing only the value 0, which it marks as the current position. It then steps forward through the circular buffer some number of steps (your puzzle input) before inserting the first new value, 1, after the value it stopped on. The inserted value becomes the current position. Then, it steps forward from there the same number of steps, and wherever it stops, inserts after it the second new value, 2, and uses that as the new current position again.\n" +
        "\n" +
        "It repeats this process of stepping forward, inserting a new value, and using the location of the inserted value as the new current position a total of 2017 times, inserting 2017 as its final operation, and ending with a total of 2018 values (including 0) in the circular buffer.\n" +
        "\n" +
        "For example, if the spinlock were to step 3 times per insert, the circular buffer would begin to evolve like this (using parentheses to mark the current position after each iteration of the algorithm):\n" +
        "\n" +
        "(0), the initial state before any insertions.\n" +
        "0 (1): the spinlock steps forward three times (0, 0, 0), and then inserts the first value, 1, after it. 1 becomes the current position.\n" +
        "0 (2) 1: the spinlock steps forward three times (0, 1, 0), and then inserts the second value, 2, after it. 2 becomes the current position.\n" +
        "0  2 (3) 1: the spinlock steps forward three times (1, 0, 2), and then inserts the third value, 3, after it. 3 becomes the current position.\n" +
        "And so on:\n" +
        "\n" +
        "0  2 (4) 3  1\n" +
        "0 (5) 2  4  3  1\n" +
        "0  5  2  4  3 (6) 1\n" +
        "0  5 (7) 2  4  3  6  1\n" +
        "0  5  7  2  4  3 (8) 6  1\n" +
        "0 (9) 5  7  2  4  3  8  6  1\n" +
        "Eventually, after 2017 insertions, the section of the circular buffer near the last insertion looks like this:\n" +
        "\n" +
        "1512  1134  151 (2017) 638  1513  851\n" +
        "Perhaps, if you can identify the value that will ultimately be after the last value written (2017), you can short-circuit the spinlock. In this example, that would be 638.\n" +
        "\n" +
        "What is the value after 2017 in your completed circular buffer?\n" +
        "\n" +
        "Your puzzle input is 304.", function (assert) {
        assert.equal(getValueInCircularBuffer(3), 638);
        assert.equal(getValueInCircularBuffer(304), 1173);
    });

        "\n" +
        "It seems like the assembly is meant to operate on a set of registers that are each named with a single letter and that can each hold a single integer. You suppose each register should start with a value of 0.\n" +
        "\n" +
        "There aren't that many instructions, so it shouldn't be hard to figure out what they do. Here's what you determine:\n" +
        "\n" +
        "    snd X plays a sound with a frequency equal to the value of X.\n" +
        "    set X Y sets register X to the value of Y.\n" +
        "    add X Y increases register X by the value of Y.\n" +
        "    mul X Y sets register X to the result of multiplying the value contained in register X by the value of Y.\n" +
        "    mod X Y sets register X to the remainder of dividing the value contained in register X by the value of Y (that is, it sets X to the result of X modulo Y).\n" +
        "    rcv X recovers the frequency of the last sound played, but only when the value of X is not zero. (If it is zero, the command does nothing.)\n" +
        "    jgz X Y jumps with an offset of the value of Y, but only if the value of X is greater than zero. (An offset of 2 skips the next instruction, an offset of -1 jumps to the previous instruction, and so on.)\n" +
        "\n" +
        "Many of the instructions can take either a register (a single letter) or a number. The value of a register is the integer it contains; the value of a number is that number.\n" +
        "\n" +
        "After each jump instruction, the program continues with the instruction to which the jump jumped. After any other instruction, the program continues with the next instruction. Continuing (or jumping) off either end of the program terminates it.\n" +
        "\n" +
        "For example:\n" +
        "\n" +
        "set a 1\n" +
        "add a 2\n" +
        "mul a a\n" +
        "mod a 5\n" +
        "snd a\n" +
        "set a 0\n" +
        "rcv a\n" +
        "jgz a -1\n" +
        "set a 1\n" +
        "jgz a -2\n" +
        "\n" +
        "    The first four instructions set a to 1, add 2 to it, square it, and then set it to itself modulo 5, resulting in a value of 4.\n" +
        "    Then, a sound with frequency 4 (the value of a) is played.\n" +
        "    After that, a is set to 0, causing the subsequent rcv and jgz instructions to both be skipped (rcv because a is 0, and jgz because a is not greater than 0).\n" +
        "    Finally, a is set to 1, causing the next jgz instruction to activate, jumping back two instructions to another jump, which jumps again to the rcv, which ultimately triggers the recover operation.\n" +
        "\n" +
        "At the time the recover operation is executed, the frequency of the last sound played is 4.\n" +
        "\n" +
        "What is the value of the recovered frequency (the value of the most recently played sound) the first time a rcv instruction is executed with a non-zero value?", function (assert) {

            {instruction: 'add', register: 'a', value: 2},

            {instruction: 'mod', register: 'a', value: 5},
            {instruction: 'snd', register: 'a'},
            {instruction: 'set', register: 'a', value: 0},
            {instruction: 'rcv', register: 'a'},
            {instruction: 'jgz', register: 'a', value: -1},
